import React from "react";
import works1 from "../assets/works1.png";
import works2 from "../assets/works2.png";
import works3 from "../assets/works3.png";
export default function Works() {
  return (
    <div>
      <div className=" mx-60">
        <h1>How it Works</h1>
        <p>Our works are the best</p>
        <div className="grid grid-cols-3 gap-4">
          <div className="bg-white">
            <img className="p-4 rounded-lg" src={works1} alt={works1}/>
            <p>Select your portfolio</p>
            <p>
                Choose a treasury portfoliotailored to your finances, iquidity horizon, goals and risk profiles
            </p>
          </div>
          <div className="bg-white">
            <img className="p-4" src={works2} alt={works2}/>
          </div>
          <div className="bg-white">
            <img className="p-4" src={works3} alt={works3}/>
          </div>
        </div>
      </div>
    </div>
  );
}
